import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
        <h5 className="my-0 mr-md-auto font-weight-normal">React Router</h5>
        <nav className="my-2 my-md-0 mr-md-3">
          <a className="p-2 text-dark" href="/">Anasayfa</a>
          <a className="p-2 text-dark" href="#">Hakkımızda</a>
          <a className="p-2 text-dark" href="#">Galeri</a>
          <a className="p-2 text-dark" href="#">İletişim</a>
        </nav>
        <a className="btn btn-outline-primary" href="#">Giriş Yap</a>
      </div>
    </div>
  );
}

export default App;
